import {useState} from 'react';
import './App.css';
import Homepage from './homepage';
import {supabase} from './supabaseClient';

function Source(){
  const [mySource, setMySource] = useState([]);
  async function getSource(){
    let { data: finalproject, error } = await supabase
      .from('finalproject')
      .select('*')
    setMySource(finalproject);
  }
  getSource();
  return (
    <table>
      {
        mySource.map(b => {
          <tr>
            <td>{b.owner}</td>
            <td>{b.source}</td>
          </tr>
        })
      }
    </table>
  );
}

function App() {
  return (
    <div className="App">
      <Homepage />

    </div>
  );
}

export default App;
